import Navbar from "../Navbar";
import Footer from "./Footer";

function StandardLayout({ children }) {
  return (
    <div>
      <Navbar />
      <div className="pt-[60px]">{children}</div>
      <Footer />
    </div>
  );
}

export default StandardLayout;
